import React, { useState, useEffect } from 'react';

const Gallery = () => {
	const [items, setItems] = useState(10);
	const [loading, setLoading] = useState(false);

	const dog = 2;

	const showItems = () => {
    var renderItems = [];
    for (var i = 0; i < 10; i++) {
      renderItems.push(<li key={i}>Item {i}</li>);
    }
    return renderItems;
	};

	

	return (
		<div>
			Gallery
			<ul>
				{showItems()}
			</ul>
			{loading ? <p>loading...</p> : ""}
		</div>
	);

};

export default Gallery;
